<!DOCTYPE html>
<html>

  <head>
    <meta charset="utf-8" />
    <!-- CSS sources -->
    <!-- IPython styles -->
    <link rel="stylesheet" type="text/css" href="/assets/themes/j1/extensions/ipython/css/style.min.css">
    <!-- Highlighter styles -->
    <link rel="stylesheet" type="text/css" href="/assets/themes/j1/extensions/ipython/css/highlight.css">
    <!-- Overrides of notebook CSS for static HTML export -->
    <link rel="stylesheet" type="text/css" href="/assets/themes/j1/extensions/ipython/css/html_export_overrides.css">
    <!-- nbInteract styles -->
    <link rel="stylesheet" type="text/css" href="/assets/themes/j1/extensions/ipython/css/nbinteract.css">

    <!-- JS sources -->
    <!-- Loads nbinteract package -->
    <!-- script src="https://unpkg.com/nbinteract-core" async></script -->
    <script src="/assets/themes/j1/extensions/ipython/js/nbinteract-core.min.js"></script>
    <!-- Require v2.3.6 -->
    <script src="https://cdnjs.cloudflare.com/ajax/libs/require.js/2.3.6/require.min.js"></script>
    <!-- iFrame Resizer Client -->
    <script src="/assets/themes/j1/extensions/iframe_resizer/js/client/iframeResizer.contentWindow.js" async></script>
    <!-- Plot.ly v1.54.0 -->
    <script src="/assets/themes/j1/extensions/ipython/js/plotly.js" async></script>

    <!-- Initialize nbinteract package -->
    <script>
      (function setupNbinteract() {
        // If NbInteract hasn't loaded, wait one second and try again
        if (window.NbInteract === undefined) {
          setTimeout(setupNbinteract, 1000)
          return
        }
        var interact = new window.NbInteract({
          spec: 'jekyll-one/jupyter_notebooks/master',
          baseUrl: 'https://mybinder.org',
          provider: 'gh'
        })
        interact.prepare()
        window.interact = interact
      })()
    </script>
  </head>

</html>
